import React, { useState } from 'react';
import './MyTrainer.css';

const MyTrainer = () => {
  const [trainer, setTrainer] = useState({
    name: 'John Doe',
    specialization: 'Strength and Conditioning',
    contact: 'johndoe@example.com',
    sessions: ['Monday: 10 AM - 11 AM', 'Wednesday: 12 PM - 1 PM', 'Friday: 4 PM - 5 PM'],
  });

  return (
    <div className="trainer-container">
      <h2>My Trainer</h2>
      <div className="trainer-details">
        <h3>Trainer Name: {trainer.name}</h3>
        <p>Specialization: {trainer.specialization}</p>
        <p>Contact: <a href={`mailto:${trainer.contact}`}>{trainer.contact}</a></p>
        <h4>Session Timings:</h4>
        <ul>
          {trainer.sessions.map((session, index) => (
            <li key={index}>{session}</li>
          ))}
        </ul>
        <button className="contact-trainer-btn">Contact My Trainer</button>
      </div>
    </div>
  );
};

export default MyTrainer;
